const genSplitsButton = document.getElementById("grubSplitGenerator")
const grubList = document.getElementById("grubList")
const listDiv = document.getElementById("listDiv")
const downloadButton = document.getElementById("downloadButton")

let xml = ""

function generateSplits() {

    grubList.textContent = ""

    let grubOrder = ""

    xml =
`<?xml version="1.0" encoding="UTF-8"?>
<Run version="1.7.0">
  <GameIcon/>
  <GameName>Hollow Knight Category Extensions</GameName>
  <CategoryName>Elegy% Random Grub Order</CategoryName>
  <LayoutPath>
  </LayoutPath>
  <Metadata>
    <Run id=""/>
    <Platform usesEmulator="False">
    </Platform>
    <Region>
    </Region>
    <Variables/>
  </Metadata>
  <Offset>00:00:00</Offset>
  <AttemptCount>0</AttemptCount>
  <AttemptHistory></AttemptHistory>
  <Segments>\n`

    let autoSplitXML =
`  </Segments>
  <AutoSplitterSettings>
    <Ordered>True</Ordered>
    <AutosplitEndRuns>True</AutosplitEndRuns>
    <AutosplitStartRuns>
    </AutosplitStartRuns>
    <Splits>\n`

      let grubSplitsCopy = JSON.parse(JSON.stringify(grubSplits))
      while (grubSplitsCopy.length > 0) {
        const index = Math.floor(Math.random() * grubSplitsCopy.length)
        const split = grubSplitsCopy[index]

        grubOrder += `${split[0]}\n`

        xml +=
        `    <Segment>
      <Name>${split[0]}</Name>
      <Icon><![CDATA[]]></Icon>
      <SplitTimes>
        <SplitTime name="Personal Best"/>
      </SplitTimes>
      <BestSegmentTime></BestSegmentTime>
      <SegmentHistory></SegmentHistory>
    </Segment>\n`

        autoSplitXML +=
        `      <Split>${split[1]}</Split>\n`

        const p = document.createElement('p')
        p.innerText = split[0]
        grubList.appendChild(p)

        grubSplitsCopy.splice(index, 1)
      }

      xml +=
      `    <Segment>
        <Name>Grubberfly's Elegy</Name>
        <Icon><![CDATA[]]></Icon>
        <SplitTimes>
          <SplitTime name="Personal Best"/>
        </SplitTimes>
        <BestSegmentTime></BestSegmentTime>
        <SegmentHistory></SegmentHistory>
        </Segment>\n`+ autoSplitXML +
      `      <Split>GrubberflysElegy</Split>
    </Splits>
  </AutoSplitterSettings>
</Run>`
    genSplitsButton.innerHTML = "Regenerate Splits!"
    downloadButton.style.visibility = "visible"
    listDiv.style.visibility = "visible"

    console.log(xml)


}

function downloadFile() {
    console.log(xml)
    const filename = "Elegy% Random Grub Order.lss";
    const pom = document.createElement('a');
    const bb = new Blob([xml], {type: 'text/plain'});

    pom.setAttribute('href', window.URL.createObjectURL(bb));
    pom.setAttribute('download', filename);

    pom.dataset.downloadurl = ['text/plain', pom.download, pom.href].join(':');
    pom.draggable = true;
    pom.classList.add('dragout');

    pom.click();
}